var unirest = require("unirest");
var req = unirest("GET", "https://api-nba-v1.p.rapidapi.com/players/lastName/Harden");

req.headers({
    "x-rapidapi-key": "7cc3303549msh7c215b7aaf9bc90p1bda16jsn74307815300f",
    "x-rapidapi-host": "api-nba-v1.p.rapidapi.com",
    "useQueryString": true
});    
req.end(function (res) {
    if (res.error) throw new Error(res.error);
	console.log(res.body);
});

function Player() {
    return (
        <div>
            <p>Test</p>
        </div>
    )
}

export default Player;
